// import React from "react";
import bgCardFront from "../images/bg-card-front.png";
import bgCardBack from "../images/bg-card-back.png";
import bgMainMobile from "../images/bg-main-mobile.png";
import cardLogo from "../images/card-logo.svg";

const Header = () => {
  return (
    <header className="header">
      <img
        className="background-header-img"
        src={bgMainMobile}
        alt="header background of a purple gradient"
      />
      <img
        className="back-of-card-header-img"
        src={bgCardBack}
        alt="back of a sample credit card"
      />
      <img
        className="front-of-card-header-img"
        src={bgCardFront}
        alt="front of a sample credit card"
      />
      <p className="back-of-card-text">000</p>
      <div className="front-of-card-text-container">
        <img src={cardLogo} alt="credit card logo" />
      </div>
    </header>
  );
};

export default Header;
